 const theDates = [
    '2019-08-27T01:11:13.000Z',
    '2020-09-27T01:11:13.000Z',
    '2010-11-27T01:11:13.000Z',
    '2020-10-27T01:10:13.000Z'
]

export const getGreaterDate = (date, dateArray) => {
    let checkdate = date
    dateArray.forEach(element => {
        date >= element ? checkdate = date : checkdate = element
    });
    console.log('checkdate')
    console.log(checkdate)
    console.log('afer checkdate')

    return checkdate > date;
}

getGreaterDate('2020-10-27T01:10:13.000Z', theDates)

console.log('before test')
console.log( new Date('2020-11-27T01:10:13.000Z') >  new Date('2020-10-27T01:10:13.000Z')  )
